import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";
import { useNavigate, redirect, Form } from "react-router-dom";
import Divider from "@mui/material/Divider";
import TextField from "@mui/material/TextField";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import HomeIcon from "@mui/icons-material/Home";
import ShareIcon from "@mui/icons-material/Share";
import ModeIcon from "@mui/icons-material/Mode";
import ClearIcon from "@mui/icons-material/Clear";
import PersonIcon from "@mui/icons-material/Person";
import ButtonBase from "@mui/material/ButtonBase";
import axios from "axios";
import { useCookies } from "react-cookie";
//axios.defaults.withCredentials = true;

async function tryLogin() {
  axios
    .post("http://localhost:3002/login", {
      username: "username",
      password: "password",
    })
    .then((response) => {
      console.log(response);
    });
}

async function creaAppartamento() {
  axios
    .post("http://localhost:3002/apartments", {
      name: "appartamento",
      description: "descrizione",
      admin: "username",
      users: ["username"],
      expanses: [],
    })
    .then((response) => {
      console.log(response);
    });
}

export default function Appartamenti() {
  const navigate = useNavigate();

  const [apartments, setApartmenst] = React.useState(null);

  React.useEffect(() => {
    axios.get("http://localhost:3002/apartments").then((response) => {
      console.log(response);
      setApartmenst(response.data);
    });
  }, []);
  console.log(apartments);

  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Container
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "100vh",
          width: "100vw",
        }}
      >
        <Container
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            height: "95vh",
            width: "100vw",
            backgroundColor: "rgb(203, 231, 253)",
            borderRadius: "5vh",
          }}
        >
          <Grid
            container
            spacing={1}
            justifyContent="center"
            alignItems="center"
            sx={{ flexGrow: 1 }}
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              height: "95%",
              width: "95%",
              //backgroundColor: "rgb(103, 131,53)",
            }}
          >
            <Grid
              container
              direction="column"
              sx={{ flexGrow: 1 }}
              style={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                height: "100%",
                width: "49%",
                //backgroundColor: "rgb(103, 131,53)",
              }}
            >
              <Grid
                style={{
                  height: "10%",
                }}
              >
                <Typography
                  variant="h4"
                  color="rgb(0, 76, 134)"
                  sx={{ fontWeight: "bold" }}
                >
                  I miei appartamenti
                </Typography>
              </Grid>
              <Grid
                container
                style={{
                  height: "90%",
                  width: "90%",
                  //backgroundColor: "rgb(44, 135, 50)",
                  overflow: "auto",
                }}
              >
                <Grid
                  style={{
                    height: "30%",
                    width: "100%",
                    marginTop: "10px",
                    //backgroundColor: "rgb(203, 231, 253)",
                  }}
                ></Grid>
              </Grid>
            </Grid>
            <Divider orientation="vertical" flexItem />
            <Grid
              container
              direction="column"
              style={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                height: "100%",
                width: "49%",
                //backgroundColor: "rgb(203, 31,53)",
              }}
            >
              <Grid
                style={{
                  height: "10%",
                }}
              >
                <Typography
                  variant="h4"
                  color="rgb(0, 76, 134)"
                  sx={{ fontWeight: "bold" }}
                >
                  Nuovo appartamento
                </Typography>
              </Grid>
              <Grid
                container
                direction="column"
                justifyContent="center"
                alignItems="center"
                style={{
                  height: "90%",
                  width: "90%",
                }}
              >
                <Grid
                  container
                  direction="column"
                  justifyContent="flex-end"
                  alignItems="center"
                  style={{
                    width: "90%",
                    height: "40%",
                  }}
                >
                  <Button
                    variant="solid"
                    style={{ background: "rgb(0, 76, 134)" }}
                    onClick={async () => {
                      await creaAppartamento();
                      console.log(localStorage.getItem("loggedin"));
                    }}
                  >
                    Crea nuovo appartamento
                  </Button>
                  <Grid
                    style={{
                      width: "90%",
                      height: "10%",
                    }}
                  ></Grid>
                </Grid>
                <Divider flexItem />
                <Grid
                  container
                  direction="column"
                  justifyContent="flex-start"
                  alignItems="center"
                  style={{
                    width: "90%",
                    height: "50%",
                  }}
                >
                  <Grid
                    style={{
                      width: "90%",
                      height: "5%",
                    }}
                  ></Grid>
                  <TextField
                    id="standard-basic"
                    label="Codice identificativo"
                    variant="standard"
                  />
                  <Grid
                    style={{
                      width: "90%",
                      height: "5%",
                    }}
                  ></Grid>
                  <Button
                    variant="solid"
                    style={{ background: "rgb(0, 76, 134)" }}
                    onClick={() => {
                      console.log("hola");
                    }}
                  >
                    Unisciti nuovo appartamento
                  </Button>
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </Container>
      </Container>
    </div>
  );
}
